--
-- Triggers `organization`
--
DROP TRIGGER IF EXISTS `trigger_log_activity_on_disable`;
DELIMITER $$
CREATE TRIGGER `trigger_log_activity_on_disable` AFTER UPDATE ON `organization` FOR EACH ROW BEGIN
	IF (NEW.record_control = '5') THEN
        SET action = 'DISABLE', 
        detail = CONCAT('Inactive organization ', NEW.organization_name, IF(LENGTH(NEW.abbreviation) > 0, CONCAT(' (', NEW.abbreviation, ')'), ''), ' - ', NEW.registration_number, ' successfully disabled'), 
        action_by = NEW.disabled_by, 
        action_date = NOW(), 
        table_name = 'Organization', 
        record_id = NEW.organization_id, 
        status = 'active';
	END IF;
END
$$
DELIMITER ;

