(1, 'Certificate of Registration', 'This is to certify that', 'TXT', 'having complied with the requirements of Section 4 and Section 20 of the Non-Governmental Organisations Act No. 3 of 2001, is registered to operate in Malawi as a', 'TXT', 'Non-Governmental Organization (NGO)', 'TXT', 'Given under my hand and Seal this', 'TXT', 'certificate_of_registration_signature.png', 'IMG', 'Voice Pearson Mhone', 'TXT', 'Registrar/CEO', 'TXT', NULL, NULL, NULL, NULL, NULL, NULL, 'admin', '2020-10-23 00:00:00', NULL, NULL, NULL, NULL, 'active'),
(2, 'License', 'This is to certify that', 'TXT', 'having complied with the requirements of Section 22 (a) and Section 35 (1) (a) (ii) of the Non-Governmental Organisations Act No. 3 of 2001, is\r\nlicensed to operate in Malawi in 2020 as a', 'TXT', 'Non-Governmental Organization (NGO)', 'TXT', 'Given under my hand and Seal this', 'TXT', 'license_signature.png', 'IMG', 'Voice Pearson Mhone', 'TXT', 'Registrar/CEO', 'TXT', NULL, NULL, NULL, NULL, NULL, NULL, 'admin', '2020-10-23 00:00:00', NULL, NULL, NULL, NULL, 'active'),
(3, 'Temporary Employment Permit Processing Certificate', 'Has been cleared having complied with Section 22 of the Non-Governmental Organisations Act 2001 for the period', 'TXT', 'The clearance is in respect of', 'TXT', 'To: Immigration Department', 'TXT', 'Designation: Chief Executive Officer/Registrar', 'TXT', 'Official Stamp', 'TXT', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'admin', '2020-10-23 00:00:00', NULL, NULL, NULL, NULL, 'active'),
(4, 'Registration Form', 'Application for registration in accordance with the Non-Governmental Organizations Act, Cap 5.05 of Laws of Malawi', 'TXT', 'The original signed filled application form must be accompanied by the following checklist:', 'TXT', 'Certified copy of the Constitution\r\nCertified copy of the Certificate of incorporation\r\nA plan of activities which the organization intends to undertake\r\nLetter of approval/MOU from the responsible Government Ministry for activities being undertaken\r\nProof that the NGO is a member of CONGOMA\r\nSources of funding\r\nGeographical location of where activities are undertaken\r\nDetails of Board of Directors/Trustees\r\nRegistration fees', 'TXT', 'While signing this registration form, the Board Chairperson or Director on affidavit confirm and certify that the information given is true to the best of their knowledge. That untrue information would be subject to cancellation of the registration certificate', 'TXT', 'NGOs operating in Malawi are subject to all the Laws of Malawi', 'TXT', 'Signed By', 'TXT', 'Applicable registration fees should be deposited or transferred into the following bank account:', 'TXT', 'Bank: National Bank of Malawi\r\nBank Account Name: NGO Board of Malawi\r\nBank Account Number: 459728\r\nService Centre Name: Capital City\r\nSwift Code: NBMAMWMW', 'TXT', 'For Board Office Use', 'TXT', NULL, NULL, 'admin', '2020-10-23 00:00:00', NULL, NULL, NULL, NULL, 'active'),
(5, 'Annual Return Form', 'Non-Governmental Organizations Act, Cap 5.05 of Laws of Malawi', 'TXT', 'This form should be filled covering your audited financial year together with the following reports:', 'TXT', 'Audited financial statements\r\nAnnual technical reports', 'TXT', 'While signing this registration form, the Board Chairperson or Director on affidavit confirm and certify that the information given is true to the best of their knowledge. That untrue information would be subject to cancellation of the registration certificate', 'TXT', 'NGOs operating in Malawi are subject to all the Laws of Malawi', 'TXT', 'Signed By', 'TXT', 'Submission will be filed with the NGO Board of Malawi within six months after the end of the financial year', 'TXT', NULL, NULL, 'For Board Office Use', 'TXT', NULL, NULL, 'admin', '2020-10-23 00:00:00', NULL, NULL, NULL, NULL, 'active');
